pragma solidity ^0.8.0;
import "./Admin.sol";
import "./utils/math/SafeMath.sol";

interface BinemonTokenI {
    function mint(address _tokenHolder) external;

    function mintWithoutEvent(address _tokenHolder) external returns (uint256);

    function forcedBurn(uint256 tokenId) external;
}

contract BinemoStore is Admin {
    uint256 public eggPrice = 199 ether;
    uint256 public remainEggs = 200000;
    uint256 public totalEggSold = 0;

    address public binemonTokenAddress;

    event Breed(
        string breedId,
        address indexed to,
        uint256 indexed tokenId,
        uint256[] parentIds
    );

    struct BreedBatchItem {
        string _breedId;
        address _tokenHolder;
        uint256[] _parentIds;
    }

    constructor(address[] memory _initAdmins, address _binemonTokenAddress)
        public
        Admin(_initAdmins)
    {
        binemonTokenAddress = _binemonTokenAddress;
    }

    function addEggs(uint256 qty) public onlyAdmin(msg.sender) {
        remainEggs = remainEggs + qty;
    }

    function buyEggs(address receiver, uint256 qty) public payable {
        uint256 price = qty * eggPrice;
        require(msg.value >= price, "not enough value");
        require(remainEggs >= qty, "not enough eggs");

        remainEggs = remainEggs - qty;
        totalEggSold = totalEggSold + qty;

        uint256 payback = uint256(msg.value) - price;
        if (payback > 0) {
            payable(msg.sender).transfer(payback);
        }

        for (uint256 i = 0; i < qty; i++) {
            BinemonTokenI(binemonTokenAddress).mint(receiver);
        }
        _claimRevenue();
    }

    function breedBatch(BreedBatchItem[] memory items)
        public
        onlyAdmin(msg.sender)
    {
        for (uint256 i = 0; i < items.length; i++) {
            breed(
                items[i]._breedId,
                items[i]._tokenHolder,
                items[i]._parentIds
            );
        }
    }

    function breed(
        string memory _breedId,
        address _tokenHolder,
        uint256[] memory _parentIds
    ) public onlyAdmin(msg.sender) {
        uint256 _tokenId =
            BinemonTokenI(binemonTokenAddress).mintWithoutEvent(_tokenHolder);

        for (uint256 i = 0; i < _parentIds.length; i++) {
            BinemonTokenI(binemonTokenAddress).forcedBurn(_parentIds[i]);
        }

        emit Breed(_breedId, _tokenHolder, _tokenId, _parentIds);
    }

    function setEggPrice(uint256 newPrice) public onlyAdmin(msg.sender) {
        eggPrice = newPrice;
    }

    function setBinemonTokenAddress(address _binemonTokenAddress)
        public
        onlyAdmin(msg.sender)
    {
        binemonTokenAddress = _binemonTokenAddress;
    }
}
